import api from "./baseApi";

export const versionApi = {
  getVersions(params, cancelToken) {
    return api.get("/api/version", { params, cancelToken });
  },
  postVersion(payload) {
    return api.post("/api/version", payload);
  },
  putVersion(id, payload) {
    return api.put(`/api/version/${id}`, payload);
  },
  deleteVersion(versionId) {
    return api.delete(`/api/version/${versionId}`);
  },
};
